<div class="container pb-5 mb-5">
	<div class="row">
		<div class="col-sm">
			<div>Atendendo à convocação conjunta da <b>APROFEM</b>, do SINESP e do SINPEEM, centenas de Profissionais de Educação, ativos, aposentados e pensionistas, compareceram na tarde de 20/03/2014 em frente à Secretaria Municipal de Educação, com o objetivo de manifestar sua indignação quanto à Lei nº 15.963, de 15 de janeiro de 2014 -  que acrescentou duas referências às tabelas de vencimentos dos Profissionais de Educação, do Quadro do Magistério Municipal e, também, quanto à minuta de decreto e portaria que deverão regulamentar a matéria.</div><div><br></div><div>Nem mesmo a forte tempestade que desabou sobre os manifestantes, durante o ato, foi capaz de dispersá-los. Todos ficaram no aguardo de possíveis respostas que os representantes das três Entidades, poderiam trazer, após terem sido recebidos pelo Sr. Secretário Municipal de Educação, Prof. Cesar Callegari.</div><div><br></div><div>Ao término dessa reunião, os dirigentes sindicais retornaram e anunciaram aos presentes que, apesar de não terem respostas concretas sobre as principais demandas apresentadas, ouviram do Secretário o compromisso de discutir este e outros temas vinculados às pautas de reivindicações apresentadas por todas as Entidades na próxima segunda-feira, 24 de março, em Mesa Setorial de Negociação da Educação, adiantando, contudo, que já haviam analisado muitas das propostas enviadas a respeito do decreto e da minuta de portaria de regulamentação das novas referências e que, muitas delas, poderão ser consideradas.</div><div><br></div><div><div><b>Ato Unificado Do Funcionalismo Municipal - 18/03/2014</b></div><div><b>Data Base 2014 - Campanha Unificada</b></div></div><div><b><br></b></div><div><div>Ocorreu, na tarde de 18 de março de 2014, em frente ao Gabinete do Prefeito, a partir das 14 horas, a Manifestação Conjunta das Entidades Representativas dos Servidores Públicos Municipais, que contou com a efetiva participação de dezessete entidades diferentes, reunindo, apesar da chuva torrencial que desabou minutos antes sobre o centro de São Paulo, milhares de manifestantes, de todas as categorias. </div><div><br></div><div>Na ocasião, representantes dos sindicatos e associações presentes, fizeram uso da palavra, registrando a união de todos em torno de nossa pauta unificada:<br><br></div><div><ul><li><span style="line-height: 1.2;">valorização dos pisos remuneratórios, com incorporação, aos padrões de vencimentos, dos abonos complementares e suplementares de pisos;</span><br></li><li><span style="line-height: 1.2;">reajuste nunca inferior à inflação e aumento real de salários;</span><br></li><li><span style="line-height: 1.2;">alteração da lei salarial, que fixa em 40% das receitas líquidas da Prefeitura as despesas com pessoal, elevando este percentual para, no mínimo, 54%;</span><br></li><li><span style="line-height: 1.2;">não à transformação da remuneração dos servidores em subsídio;</span><br></li><li><span style="line-height: 1.2;">fim das terceirizações;</span><br></li><li><span style="line-height: 1.2;">isonomia entre ativos e aposentados.</span><br></li></ul></div><div>Mesmo reiterando apoio à Pauta Unificada, cada entidade também deixou claro que isso não significa, de modo algum, que deixarão de lutar por suas pautas específicas.</div><div><br></div><div>Em seguida, os representantes de cada uma das Entidades foram recebidos pelos interlocutores do Governo e tiveram a oportunidade de expressar, cada um à sua vez, a insatisfação daqueles a quem representam, relativamente à política praticada, por sucessivos governos, de sucateamento dos serviços públicos, através da desvalorização gradativa dos servidores. A <b>APROFEM</b> registrou, ainda, que os milhares de servidores, concentrados à porta do Gabinete do Prefeito, eram a maior prova do apoio inconteste à pauta proposta, para a qual esperavam, do Governo, respostas que viessem ao encontro de suas expectativas.</div><div><br></div><div>O representante do Governo junto às Mesas de Negociação manifestou-se através dos surrados argumentos de que a Prefeitura não conseguiu a majoração dos valores do IPTU nos percentuais propostos, o que ocasionou uma arrecadação menor do que a pretendida, além de ter uma enorme dívida com a União e também com precatórios. </div><div><br></div><div><span style="line-height: 1.2;">Argumentou, ainda, que não tinha respostas para nossas reivindicações naquele momento, propondo um calendário de negociação, conforme segue:</span></div><div><span style="line-height: 1.2;"><br></span></div><div><ul><li><span style="line-height: 1.2;">25/03/2014 - apresentação de resposta às Entidades sobre nossa pauta, por meio eletrônico ou com uma Reunião Extraordinária da Mesa Central de Negociação;</span><br></li><li><span style="line-height: 1.2;">27/03/2014 - Reunião Ordinária da Mesa Central de Negociação (já agendada anteriormente) para ouvir as Entidades.</span><br></li><li><span style="line-height: 1.2;">Até 18/04/2013 - Encerramento das negociações sobre a data base de 2014.</span><br></li></ul></div><div><br></div><div>Retornando ao local da manifestação, os representantes das Entidades comunicaram aos presentes as informações acima, complementando com a informação de que o Fórum de Entidades Sindicais reunir-se-á para analisar a resposta do Governo e deliberar pelos próximos encaminhamentos.</div></div><div><br></div><div><b>Propostas Específicas para os Profissionais de Educação</b><br></div><div><b><br></b></div><div><div>Na tentativa de esvaziar nossa manifestação, o Governo Municipal divulgou que será aplicado um reajuste de 13,43% a partir de 01/05/2014, que nada mais é do que a obrigação de cumprir o que já foi determinado pela Lei nº 15.215, de 25/06/2010, a título de incorporação do abono complementar concedido na ocasião e que, justamente por isso, nada representará para os que estão no início da carreira docente.</div><div><br></div><div>A<b> APROFEM</b> protocolou, junto ao Gabinete da Secretaria Municipal de Educação, a seguinte 